// SPDX-License-Identifier: MIT

pragma solidity >=0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";

contract VotingSystem is Ownable {
    struct Proposal {
        uint256 id;
        string description;
        address creator;
        uint256 startTime;
        uint256 endTime;
        uint256[] options;
        bool executed;
        mapping(uint256 => uint256) votes;
    }

    constructor() Ownable(msg.sender) {
        // Any other constructor logic
    }

    struct Voter {
        bool hasVoted;
        uint256 weight;
        uint256 votedOption;
    }

    uint256 private nextProposalId = 1;

    mapping(uint256 => Proposal) proposals;

    mapping(uint256 => mapping(address => Voter)) public votes;

    mapping(address => uint256) public voterRecords;

    event ProposalCreated(
        uint256 indexed id,
        string description,
        address indexed createdBy,
        uint256 startTime,
        uint256 endTime,
        uint256[] options
    );

    event VoteCast(
        uint256 indexed id,
        address indexed voter,
        uint256 weight,
        uint256 votedOption
    );

    function createProposal(
        string memory _description,
        uint256 _startTime,
        uint256 _endTime,
        uint256[] memory _options
    ) external onlyOwner {
        require(bytes(_description).length > 0, "Description is required");

        require(
            _startTime > block.timestamp,
            "Start Time should be in the future"
        );

        require(_endTime > _startTime, "End time should be after Start Time");

        require(
            _options.length >= 2,
            "Atleast two options required for voting"
        );

        uint256 ProposalId = nextProposalId++;

        Proposal storage P = proposals[ProposalId];

        P.id = ProposalId;

        P.description = _description;

        P.creator = msg.sender;
        P.startTime = _startTime;
        P.endTime = _endTime;

        P.executed = false;

        for (uint i = 0; i < _options.length; i++) {
            P.options.push(_options[i]);
            P.votes[_options[i]] = 0;
        }

        emit ProposalCreated(
            ProposalId,
            _description,
            msg.sender,
            _startTime,
            _endTime,
            _options
        );
    }
}

